import {NavLink} from 'react-router-dom';
import {Link} from 'react-scroll';
import './index.scss';

const HomeHeader = () => {
  return (
    <header className="home-header">
      <div className="home-header__container">
        <div className="home-header__text">
          <h1 className="home-header__title">Zacznij pomagać!</h1>
          <h1 className="home-header__title">Oddaj niechciane rzeczy w zaufane ręce</h1>
          <div className="home-header__decoration"></div>
          <div className="home-header__buttons">
            <Link to="home-three-columns" smooth={true} duration={1000} className="home-header__button">ODDAJ RZECZY</Link>
            <NavLink to="/logowanie" className="home-header__button">ZORGANIZUJ ZBIÓRKĘ</NavLink>
          </div>
        </div>
        <div className="home-header__image"></div>
      </div>
    </header>
  );
}

export default HomeHeader;
